  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0106340 includes profile,
  undulating profile, biological, chemical and physical data collected aboard the
  ENDEAVOR during cruises EN321 and EN325 in the North Atlantic Ocean from 1999-03-30
  to 1999-06-27. These data include CHLOROPHYLL A, SALINITY, HYDROSTATIC PRESSURE,
  DISSOLVED OXYGEN, TEMPERATURE and SIGMA-T. The instruments used to collect these
  data include Undulating towed profiler and CTD. These data were collected by Dian
  J. Gifford and Karen Wishner of University of Rhode Island as part of GB. The Biological
  and Chemical Oceanography Data Management Office (BCO-DMO) submitted these data
  to NODC on 2013-04-25.nnThe following is the text of the abstract provided by BCO-DMO:nnSCANFISH
  CTD Data Endeavor Cruises 321 and 325nPI Notes:nThe Scanfish is a towed undulating
  vehicle carrying a CTD and several other sensors and was utilized on Endeavor Cruises
  321 and 325 to Georges Bank. The scanfish is towed along various transacts to map
  the hydrographic properties of a survey area. During each cruise a number of tows
  were carried out, and the data are organized by tow. The SeaBird 911plus CTD records
  data at 24 Hz. It has been processed following the procedures outlined by O'Malley,
  et al (1998) and subsequently averaged to 1 Hz.nnREFERENCEnO'Malley, R., J. A. Barth,
  A. Erofeev, J. Fleischbein, P. M. Kosro, and S. D. Pierce. SeaSoar CTD Observations
  During the Coastal Mixing and Optics Experiment: R/V Endeavor Cruises from 14-Aug
  to 1-Sep 1996 and 25-Apr to 15-May 1997. College of Oceanic & Atmospheric Sciences,
  Oregon State University, Corvallis. Reference 98-1, Data Report 168, October 1998.nQuestions
  regarding these data should be directed to:nDian J. GiffordnGraduate School of OceanographynUniversity
  of Rhode IslandnNarragansett, RI 02882-1197nphone: 401-874-6690nfax: 401-874-6240nE-mail:
  gifford@gsosun1.gso.uri.edu (mailto:gifford@gsosun1.gso.uri.edu)nnornnKaren WishnernGraduate
  School of OceanographynUniversity of Rhode IslandnNarragansett, RI 02882-1197nphone:
  401-874-6402nE-mail: kwishner@gsosun1.gso.uri.edu ()nnLast updated, March 24, 2006,
